import React from 'react'

const Image = props => {
  const { image } = props

  return (
    <div className="col-md-4">
      <div className="card mb-4 shadow-sm">
      <div className="card-body">
        {image.hasImage && (
          <img src={image.webImage.url} className="card-img" alt="..." />
        )}
        
      </div>
      </div>
    </div>
  )
}

export default Image
